import React, { useState, useEffect } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Button, Typography } from '@mui/material';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';
import axios from 'axios';

function ListNameStudentS2() {
    const [students, setStudents] = useState([]);
    const [projects, setProjects] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                // Fetch students and projects data
                const [studentsResponse, projectsResponse] = await Promise.all([
                    axios.get('http://localhost:9999/students'),
                    axios.get('http://localhost:9999/Project')
                ]);

                const studentsData = studentsResponse.data;
                const projectsData = projectsResponse.data;

                // Extract student IDs who have consented
                const consentedStudentIds = projectsData
                    .filter(project => project.P_CSB03) // Check if P_CSB03 is true or has a value
                    .map(project => project.S_id); // Get student IDs

                // Filter students based on consented IDs and specific status
                const filteredStudents = studentsData.filter(student => 
                    consentedStudentIds.includes(student.S_id) && student.S_T_SP2 === true // Check for S_T_SP2 being true
                );

                setStudents(filteredStudents);
                setLoading(false);
            } catch (err) {
                setError('Failed to fetch data');
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    const handleButtonClick = (id) => {
        // Handle button click action
        console.log(`Button clicked for student with ID: ${id}`);
    };

    if (loading) return <Typography>Loading...</Typography>;
    if (error) return <Typography>{error}</Typography>;

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <div>
                                <Typography sx={{ marginLeft: 80 }}>
                                    <h1>รายชื่อนักศึกษาโครงการพิเศษสองภาษา</h1>
                                </Typography>
                                <TableContainer>
                                    <Table>
                                        <TableHead>
                                            <TableRow>
                                                <TableCell>ลำดับที่</TableCell>
                                                <TableCell>รหัสนักศึกษา</TableCell>
                                                <TableCell>ชื่อ-สกุล</TableCell>
                                                <TableCell>สถานะโครงงาน</TableCell>
                                                <TableCell>รายละเอียดเพิ่มเติม</TableCell>
                                            </TableRow>
                                        </TableHead>
                                        <TableBody>
                                            {students.map((student, index) => (
                                                <TableRow key={student.S_id}>
                                                    <TableCell>{index + 1}</TableCell>
                                                    <TableCell>{student.S_id}</TableCell>
                                                    <TableCell>{student.S_name}</TableCell>
                                                    <TableCell>{student.StatusProject}</TableCell>
                                                    <TableCell>
                                                        <Button onClick={() => handleButtonClick(student.S_id)}>Link</Button>
                                                    </TableCell>
                                                </TableRow>
                                            ))}
                                        </TableBody>
                                    </Table>
                                </TableContainer>
                            </div>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
}

export default ListNameStudentS2;
